        dp[0][i][1] = dp[0][i - 1][1] + a[i - 1]
        dp[1][i][1] = max(dp[0][i - 1][1], dp[1][i - 1][1]) - a[i - 1]
        dp[2][i][1] = max(dp[1][i - 1][1], dp[2][i - 1][1]) + a[i - 1]
        dp[3][i][1] = max(dp[2][i - 1][1], dp[3][i - 1][1]) - a[i - 1]
    dp_indx = [0, 0, 0, 0]
    pt = 3
    for i in range(n, 0, -1):
        if dp[pt][i][1] < dp[pt - 0][i][1]:
            pt -= 1
            dp_indx[pt] = i
        if pt == 0:
